import React from 'react';
import './css/middle.css';


import animage from './img/back.png';

function Middle(){
    return(
<div>
        <img src={animage} className="App-background" alt="background" />
        <div className="App-middle">Monica VO</div>
        </div>
    );
}

export default Middle;
